import SBLogo from "./SBLogo";
import SearchBar from "./SearchBar";

const SBContainer = () => {
  return (
    <div className="SBConatiner">
      <div className="SearchBar">
        <div className="SBContentContainer">
          <SBLogo></SBLogo>
        </div>
        <div className="SBContentContainer">
          <SearchBar></SearchBar>
        </div>
        <div className="SBContentContainer"></div>
      </div>
    </div>
  );
};

export default SBContainer;
